DROP TABLE IF EXISTS stu;
CREATE TABLE stu(
	id BIGINT(20) AUTO_INCREMENT PRIMARY KEY NOT NULL COMMENT '学号',
	name VARCHAR(30) NOT NULL COMMENT '姓名',
	sex TINYINT(1) UNSIGNED DEFAULT 0 COMMENT '性别：0-男，1-女，2-其他',
	birthday DATE NOT NULL COMMENT '出生日期',
	class VARCHAR(30) NOT NULL COMMENT '所属班级'
)ENGINE=InnoDB CHARSET=UTF8 COMMENT '学生表';

DROP TABLE IF EXISTS score;
CREATE TABLE score(
	id BIGINT(20) AUTO_INCREMENT PRIMARY KEY NOT NULL COMMENT '成绩编号',
	stu_id BIGINT(20) NOT NULL COMMENT '学号',
	course VARCHAR(30) NOT NULL COMMENT '课程',
	score DOUBLE(5, 2) COMMENT '成绩'
)ENGINE=InnoDB CHARSET=UTF8 COMMENT '学生表';
